import React from 'react';

/**
 * Removed Firebase Debugger
 * Empty component to prevent errors when imported elsewhere
 */
const FirebaseDebugger = () => {
  // Return empty div with no Firebase connections
  return null;
};

export default FirebaseDebugger;
